INSERT INTO users (name, password, email, tutor, bio) VALUES ('Kevin Wang', 'password', 'kevin@gmail.com', 0, "I am from New Jersey and rreceived my BS in Kinesiology from Rutgers. In my free time I enjoy the outdoors and good game of Blockus");
INSERT INTO users (name, password, email, tutor, bio) VALUES ('Daniel Novograd', 'password', 'daniel@gmail.com', 0, "I am an associate at PolicyGenius. We are changing a massive industry by making insurance shopping faster, friendlier and more transparent for online consumers. Since our launch in 2014, we’ve achieved rapid growth in a notoriously difficult industry and established ourselves as a pioneer in a now hot sector of FinTech.");
